import { MainLayout } from '../../Layout/MainLayout'
import SaleComponent from '../../components/SaleComponent/SaleComponent'
import { useEffect } from 'react'

const Sale = ({motors: serverMotors}) => {
  useEffect(() =>{
    const load = async () =>{
      const response = fetch('http://wp-test/wp-json/custom-routes/v1/tablemotor')
      const tableData = await response.json()
      console.log(tableData)
    }
    load()
  },[])
  return (
      <MainLayout title={'Распродажа'}>
        <div className={'flexWrapper'}>
          {
            <SaleComponent
                motors={serverMotors}/>
          }
        </div>
      </MainLayout>
  )
}

export const getServerSideProps = async () => {
  const response = await fetch('http://wp-test/wp-json/custom-routes/v1/motorfiltered')
  const responseData = await response.json()
  return {
    props: {motors: responseData}
  }
}

export default Sale
